long_desc.thetext:
Gene Amtower has reported a problem on the mailing list. If you use a SelectBox with a inline application and the div container for the SelectBox has a center elements as parent node, than the SelectBox is mispositioning in IE6.

Code to reproduce the issue:
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.1//EN" "http://www.w3.org/TR/xhtml11/DTD/xhtml11.dtd">
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en">
<head>
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
  <title>testSelectBox</title>
  <script type="text/javascript" src="script/testselectbox.js"></script>
</head>
<body>
  <center><b>Customer</b><br><div id="ordercustomer"></div></center>
</body>
</html>

var custfield = document.getElementById("ordercustomer");
var inlineCust = new qx.ui.root.Inline(custfield);
var cust = new qx.ui.form.SelectBox();
inlineCust.add(cust, {left:0, top:0});

// Populate the SelectBox widget with test data...
for (var tr=0; tr<5; tr++)
{
  var item = new qx.ui.form.ListItem("Test Stuff"+tr, null, "" + tr);
  cust.add(item);
}
